import { Component } from '@angular/core';

@Component({
  selector: 'app-read-file',
  templateUrl: './read-file.component.html',
  styleUrls: ['./read-file.component.css']
})
export class ReadFileComponent {

}
<form>
  <div class="form-group">
    <input type="file" class="form-control-file" id="fileInput" required>
    <label class="custom-file-label" for="fileInput">Example file input</label>
    <div class="invalid-feedback">
  	Must be a 5.5.1 GedCom file.
	</div>
  </div>
  <button type="submit" class="btn btn-primary">Submit</button>
</form>
